    { id: 1, name: 'Beatriz', grade: 7.2 },
    { id: 2, name: 'Carlos', grade: 7.1 },
    { id: 3, name: 'Daniel', grade: 6.8 },
    { id: 4, name: 'Fábio', grade: 5.4 },
    { id: 5, name: 'Gabriela', grade: 8.9 },
    { id: 6, name: 'Helena', grade: 7.5 },
    { id: 7, name: 'Igor', grade: 5.2 },
    { id: 8, name: 'Jaqueline', grade: 9.1 },
    { id: 9, name: 'Kevin', grade: 8.5 },
]

console.log(students)
const list = students.map(student => {
    const { studentId, name, grade } = student
        (
            <li key={studentId} style={{ listStyle: 'none' }}>
                {studentId + 1}) {name}: {grade}
            </li>
        )
})

export default () => {

    return (
        <ul>
            {list}
        </ul>
    )
}
